import React, { useState } from "react";
import styles from "./Acquire.module.css";
import Button from "../../../../ui/button/button";

const Acquire = (props) => {
  const [radioSelect, setRadioSelect] = useState("amazon");

  const onSelectRadio = (e) => {
    setRadioSelect(e.target.value);
  };
  return (
    <div className={styles.Container}>
      <div className={styles.SummaryContainer}>
        <div className={styles.RadioContainer}>
          <label className={styles.Radio}>
            Amazon
            <input
              type="radio"
              name="radio"
              value="amazon"
              checked={radioSelect === "amazon"}
              onChange={onSelectRadio}
            />
            <span className={styles.Circle}></span>
          </label>
          <label className={styles.Radio}>
            AbeBook
            <input
              type="radio"
              name="radio"
              value="abe"
              checked={radioSelect === "abe"}
              onChange={onSelectRadio}
            />
            <span className={styles.Circle}></span>
          </label>
        </div>

        <div className={styles.Summary}>
          <div className={styles.LeftView}>
            <img
              src="https://vignette.wikia.nocookie.net/pandorahearts/images/a/ad/Not_available.jpg/revision/latest?cb=20141028171337"
              alt="book-image"
            />
            <Button
              className={style.btn}
              style={{
                backgroundColor: "transparent",
                color: "#51087e",
                border: "1px solid #51087e",
                borderRadius: "5px",
              }}
            >
              Check Usefulness
            </Button>
          </div>
          <ul>
            <li>Name: </li>
            <li>Publisher: </li>
            <li>PublishedDate: </li>
            <li>Edition: </li>
            <li>Price: </li>
            <li>Summary: </li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Acquire;
